commit_message:
Merge pull request #367 from dawagner/cpack-components The following components are declared:

    runtime (libparameter and libremote-processor);
    dev (everything necessary to develop a plugin or a client: headers, cmake package files, ...);
    c (the C bindings, i.e. libcparameter);
    cdev (everything necessary to develop a client using the C bindings);
    python (the Python bindings);
    eng (the various tools, XML schemas, ...);
    runtime-deps (on windows only: the msvc redistributable files).

Then, CPack can be used to generate separate packages.

domainGeneratorConnector: allow empty arguments The domain generator was using the "merge delimiters" behaviour of the
tokenizer which made it impossible to have empty tokens; e.g.:

- empty rules;
- empty config/domain names (even though this is forbidden, this is not for the
  generator to decide);
- empty string parameter value;
- ...

It now uses the new "don't merge delimiters" behaviour.

Signed-off-by: David Wagner <david.wagner@intel.com>

Compilation: more doc and sane defaults - Do not turn BASH_COMPLETION buid option on by default on Windows;
- Fix a typo in an option documentation;
- List known dependencies in the README;
- Give some pointers on how to easily compile on Windows;
- Print an error if SWIG isn't found when Python bindings are to be compiled.

Signed-off-by: David Wagner <david.wagner@intel.com>

bindings: bind ILogger and setLogger() This will allow users of the parameter-framework bindings to set a logger;
without it, the parameter-framework wasn't able to log anything.

Some SWIG features and workarounds must be activated in order to:

 - Support nested classes;
 - Derive bound classes and allow C++ to call back the user-created objects;
 - Properly handle exceptions that may be raised upon errors happening on the
   user side.

Change-Id: I955152a4658eff3307ad595f175f2624a3acfa8c
Signed-off-by: David Wagner <david.wagner@intel.com>

Add CMake Makefiles 1) Generate the Makefiles with "cmake";
2) compile all targets with "make".

Signed-off-by: David Wagner <david.wagner@intel.com>
